import { Outlet, Link } from "react-router-dom";
import { useAuthContext } from "../contexts/AuthContext";
import Navbar from "./Navbar";


function Layout() {
  const { auth } = useAuthContext();
  return (
    <div>
      {auth && <Navbar />}
      <main className="App">
        <Outlet />
        
      </main>
    </div>
  );
}

export default Layout;
